import React, { useState } from 'react';


const Navbar = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <div className="navbar-inner">
      <div className="navbar-bg-color" style={{ opacity: 0 }}></div>
      <div className="navbar-bg-shadow" style={{ opacity: 0 }}></div>
      <div className="navbar-container">
        <div className="navbar-component">
          <a href="/" className="navbar-logo w-nav-brand" aria-label="home">
            <img 
              src="https://cdn.prod.website-files.com/63ca0685daa2425d2057a7a8/665c9a32fb0331aa2eec8726_cake-equity-logo.png" 
              alt="Cake Equity Logo"
              className="image-100"
            />
          </a>
          <nav role="navigation" className="navbar-menu w-nav-menu">
            <div className="menu-wrapper">
              <div className={`nav-menu-dropdown w-dropdown ${dropdownOpen ? 'open' : ''}`}>
                <div 
                  className="nav-menu_link-wrap w-dropdown-toggle" 
                  onClick={toggleDropdown}
                  aria-haspopup="menu"
                  aria-expanded={dropdownOpen}
                  role="button"
                  tabIndex={0}
                >
                  <div className="nav-dropdown-inner">
                    <div>Product</div>
                    <div className="nav-dropdown-icon w-icon-dropdown-toggle"></div>
                  </div>
                  <div className="absolute-border" style={{ width: '0%', height: '2px' }}></div>
                </div>
                {dropdownOpen && (
                  <nav className="nav-dropdown w-dropdown-list">
                    <div className="navbar-container for-dropdown">
                      {/* Add your menu items here */}
                    </div>
                  </nav>
                )}
              </div>
            </div>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
